import React from "react";
import PropTypes from 'prop-types';

class FormResidencia extends React.Component{
  render() {
    const { handler } = this.props;
    return(
      <fieldset>
        <label>
          Residencia:
          <br></br>
          <label htmlFor="house">
            <input
              type="radio"
              id="house"
              name='residencia'
              value='casa'
              onChange={handler}>
            </input>
            Casa
          </label>
          <br></br>
          <label htmlFor="apart">
            <input
              type="radio"
              id="apart"
              name='residencia'
              value='casa'
              onChange={handler}>
            </input>
            Apartamento
          </label>
        </label>
      </fieldset>
    )
  }
}

FormResidencia.propTypes = {
  handler: PropTypes.func.isRequired,
  residencia: PropTypes.string.isRequired,
};

export default FormResidencia;
